import React from 'react';
import './About.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'



const About = () => {
    return (
        <div className='about-container'>
            
            <FontAwesomeIcon icon={sol('user-secret')} />


        </div>
    );
};

export default About;
